#实现一个广度优先的计算矩阵中所有点到特定点的距离
#Given a matrix consists of 0 and 1, find the distance of the nearest 0 for each cell.
#The distance between two adjacent cells is 1.
#可以想象成初始的0格子开始轮流一层层扩大自己地盘，最多差一层，然后在相交的层会互相更新最近距离
import sys,queue

class Solution(object):
    def updateMatrix(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: List[List[int]]
        """
        #首先将矩阵中的1的点值设置为无穷sys.maxsize,将0的点放进队列
        xlen=len(matrix)
        ylen=len(matrix[0])
        maxlen=xlen+ylen+1
        my_queue=queue.Queue()#queue中存放的是点的坐标
        for x,datalist in enumerate(matrix):
            for y,data in enumerate(datalist):
                if data ==0:
                    my_queue.put([x,y])
                    #print(x,y)
                else:
                    matrix[x][y]=maxlen#sys.maxsize,一个矩阵，最大的曼哈顿距离就是xy上的长度和
        #思路是用所有0和知道到0距离的点去更新周边的点，动态的添加更新过的点到队列中，相当于递归
        dir=[[-1,0],[1,0],[0,-1],[0,1]]
        while not my_queue.empty():
            cur_point=my_queue.get()
            #print(cur_point)
            for detx,dety in dir:    
                next_point=[cur_point[0]+detx,cur_point[1]+dety]
                if next_point[0]>=0 and next_point[0]<xlen and next_point[1]>=0 and next_point[1]<ylen :#超出矩阵范围或者无法更新周围点距离
                    if matrix[next_point[0]][next_point[1]] == maxlen:
                        my_queue.put(next_point)
                    matrix[next_point[0]][next_point[1]]=min(matrix[cur_point[0]][cur_point[1]]+1,matrix[next_point[0]][next_point[1]])
        return matrix

